import './topbar.scss';

export default function TopBar() {
    return (
        <div className='topbar'>
            <div className="wrapper">
                <div className="left">
                    <a href="#intro" className='logo'>Intro</a>
                </div>
                <div className="right">
                    this is right
                </div>
            </div>
        </div>
    )
}
